// Get the webhook data from the input
const webhookData = $input.item.json;

// Access the transcript array
const transcript = webhookData.body.data.transcript;

// Format the transcript into a clean string
const formattedTranscript = transcript.map(entry => {
  // Capitalize the role for better readability
  const role = entry.role.charAt(0).toUpperCase() + entry.role.slice(1);
  return `${role}: ${entry.message}`;
}).join('\n'); // Join each line with a newline

// Return the formatted transcript
return {
  json: {
    clean_transcript: formattedTranscript
  }
};
